import "./App.css";
import {Head} from "./componentes/headboard/head.jsx"

function App() {

  return (

        <div className="App">
          <Head/>
        <div>

        <div className="AppHomeppal">
        </div>
          <Homeppal/>
        </div>
      
    </div>
    
  );
}

export default App;
